import React, { Component } from 'react';
import { UserConsumer } from './UserContext';

class ComponentF extends Component {
    render() {
        console.log("hello");
        return(
            <UserConsumer>
                {
                    username => {
                        return <div>Hello {username}</div>
                    }
                }
            </UserConsumer>
        )
    }
}

export default ComponentF;
